import React, { Component } from 'react'

class SignUp extends Component {
    render() {
        const inline = {height:'100%',padding:8,margin: '10px 15px', border: '3px solid #4f3949',position:'relative'}
        return (
            <div style={inline}>
                
            </div>
        )
    }
}
export default SignUp
